/* Handle C-style character escape sequences: return 010 for 'b' and
   so on. */

static int
c_char_escape (int c)
{
    switch (c) {
    case '"':	return '"';
    case '\'':	return '\'';
    case '\\':	return '\\';
    case '0':	return '\0';
    case 'b':	return '\b';
    case 'f':	return '\f';
    case 'n':	return '\n';
    case 'r':	return '\r';
    case 't':	return '\t';
    case 'v':	return '\v';
    default:
	warning ("unknown escape sequence '\\%c' handled as mere '%c'\n", c, c);
	return c;
    }
}

